import React from "react";
import "./footer1.css";
function Footer1() {
  return (
    <section id="footer">
      <div className="logo-end">
       
          <img src="/logo.png" className="le" alt="Logo" />
    
      </div>
      <div className="whole">
        <div className="left">
          <p className="p1">More about Home </p>
          <p className="p2">
            Find free, easy-to-follow recipes you can cook at home from
            Australia's best brands. From timeless classics to modern trends,
            budget dinners to entertaining delights, save your favourite
            recipes, upload your own creations and create personalised digital
            cookbooks all on myfoodbook.{" "}
            <a href="AboutUs.html" className="af">
              Learn more about what makes us different from other recipe sites.
            </a>{" "}
            To start your search, check out some{" "}
            <a href="Breakfast.html" className="af">
              breakfast recipes
            </a>{" "}
            and get cooking!
          </p>
        </div>

        <div className="right">
          <p>Sign up for the latest recipes and news</p>
          <input type="email" placeholder="email address" />
          <button class="button1" >Subscribe</button>
          <p style={{ marginTop: "30px" }}>Follow Recipe Realm</p>
          {/* Make sure Font Awesome icons are imported properly */}
          <i className="fab fa-facebook"></i>
          <i className="fab fa-pinterest"></i>
          <i className="fab fa-youtube"></i>
          <i className="fab fa-instagram"></i>
        </div>
      </div>
    </section>
  );
}

export default Footer1;
